import { GET_CONTACT } from '../../../action/admin/contact/action_type';


const initialState = {
    contacts : []
}


export default function contactReducer(state = initialState , action ) {
    if(action.type == GET_CONTACT) {
        return Object.assign({},state,{contacts : action.payload})
    }else{
        return state;
    }
}
